import React from 'react';

function App() {
  return (
    <div style={{ 
      minHeight: '100vh', 
      display: 'flex', 
      alignItems: 'center', 
      justifyContent: 'center',
      backgroundColor: '#f0fdf4'
    }}>
      <div style={{ textAlign: 'center' }}>
        <h1 style={{ color: '#16a34a', fontSize: '3rem', marginBottom: '1rem' }}>
          Smart Farm Connect
        </h1>
        <p style={{ fontSize: '1.2rem', color: '#374151' }}>
          Agricultural Platform for South Sudan
        </p>
      </div>
    </div>
  );
}

export default App;
